import React, { Component } from 'react'

class SearchForm extends Component {
    constructor(props){
        super(props);
        this.state= {
            isSearch: false
        };
        this.submitForm= this.submitForm.bind(this);
    }

    submitForm(event){
        console.log("Form submit edildi");
        return false;
    }

    render() {
        return (
            <div>
                <div className="row">
                    <form onSubmit="{this.submitForm}">
                        <div className="col-12">
                            <div className="mb-3">
                                <input type="text" className="form-control" id="firstName" placeholder="Birşeyler yazın..." />
                            </div>
                            <div className="mb-3">
                                <input  className="btn btn-primary btn-lg btn-block" type="submit" value="Gif Ara" />
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
}

export default SearchForm;
